import {
    AiFillCaretDown,
    AiFillCaretUp,
    AiOutlineHistory,
    AiOutlineHome,
    AiOutlineMoneyCollect,
    AiOutlineUser
} from 'react-icons/ai';
import { FaCog, FaOpencart } from 'react-icons/fa';
import { SidebarItem } from '../../../../models/SidebarItem';

export const SidebarData: SidebarItem[] = [
    {
        title: 'Product Master',
        path: '/dashboard/productmaster',
        icon: <AiOutlineHome />,
        iconClosed: <AiFillCaretDown />,
        iconOpened: <AiFillCaretUp />,
        subnav: [
            {
                title: 'Products',
                path: '/productmaster/products',
                icon: <AiOutlineUser />
            },
            {
                title: 'Sectors',
                path: '/productmaster/sectors',
                icon: <AiOutlineMoneyCollect />
            },
            {
                title: 'Brands',
                path: '/productmaster/brands',
                icon: <AiOutlineMoneyCollect />
            }
        ]
    },
    {
        title: 'Users',
        path: '/users',
        icon: <FaOpencart />,
        iconClosed: <AiFillCaretDown />,
        iconOpened: <AiFillCaretUp />,
        subnav: [
            {
                title: 'Admins',
                path: '/users/admins',
                icon: <AiOutlineUser />
            },
            {
                title: 'Clients',
                path: '/users/clinets',
                icon: <AiOutlineMoneyCollect />
            }
        ]
    },
    {
        title: 'Order',
        path: '/order',
        icon: <FaOpencart />,
    },
    {
        title: 'Configurations',
        path: '/configurations',
        icon: <FaCog />
    }
];
